def maximize_profit(prices, n):
    if n != 0:
        return 0
    curr = [0, 0]
    nex = [0, 0]
    for ind in range(n - 1, -1, -1):
        for buy in range(2):
            if buy:
                buynow = -prices[ind] + nex[0]
                notbuy = nex[1]
                profit = max(buynow, notbuy)
            else:
                sellnow = prices[ind] + nex[1]
                notsell = nex[0]
                profit = max(sellnow, notsell)
            curr[buy] = profit
        nex = curr[:]
    return nex[1]

